      {"1b5057cd-2d68-47d0-8891-91f6d14e05f8":{"version":"3.4.3","title":"Bokeh Application","roots":[{"type":"object","name":"Tabs","id":"p11559","attributes":{"sizing_mode":"stretch_both","tabs":[{"type":"object","name":"TabPanel","id":"p11550","attributes":{"title":"Summary","child":{"type":"object","name":"Div","id":"p11549","attributes":{"styles":{"type":"map","entries":[["width","100%"],["height","100%"],["max-width","1920px"],["max-height","1080px"],["padding","12px"],["border","1px solid lightgray"],["box-shadow","inset 1px 0 8px 0 lightgray"],["overflow","auto"]]},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 381.80 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 7252 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 129.92 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:32876 &lt;/li&gt;\n          &lt;li&gt; Workers: 4 &lt;/li&gt;\n          &lt;li&gt; Threads: 8 &lt;/li&gt;\n          &lt;li&gt; Memory: 59.60 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2024.5.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2024.5.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef test_dask_config(n_workers, threads_per_worker, chunk_size, total_memory_limit=128):\n    \"\"\"\n    Test Dask configuration dynamically allocating memory per worker and thread.\n\n    Args:\n        n_workers (int): Number of Dask workers.\n        threads_per_worker (int): Threads per Dask worker.\n        chunk_size (int): Dataset chunk size.\n        total_memory_limit (int): Total memory limit in GB.\n    \"\"\"\n    # Calculate memory per worker based on total memory\n    memory_per_worker = total_memory_limit // (n_workers * threads_per_worker)\n    print(f\"Testing: Workers={n_workers}, Threads={threads_per_worker}, Chunk Size={chunk_size}, Memory={memory_per_worker}GB per worker\")\n\n    client = None  # Initialize client\n    try:\n        # Initialize Dask client\n        client = Client(n_workers=n_workers, threads_per_worker=threads_per_worker, memory_limit=f\"{memory_per_worker}GB\")\n        report_path = os.path.join(output_dir, f\"report_{n_workers}w_{threads_per_worker}t_{chunk_size}c.html\")\n\n        with performance_report(filename=report_path):\n            start_time = time.time()\n            train_dataset = LaneDatasetWithDask(dataset_path=\"./dataset/TUSimple\", train=True, size=(800, 360))\n            for idx in tqdm(range(len(train_dataset)), desc=f\"Processing with {n_workers}w, {threads_per_worker}t\"):\n                _ = train_dataset[idx]  # Simulate loading each data point\n            total_time = time.time() - start_time\n\n        print(f\"Completed in {total_time:.2f} seconds\")\n        results.append((n_workers, threads_per_worker, chunk_size, memory_per_worker, total_time))\n    except Exception as e:\n        print(f\"Error: {e}\")\n        results.append((n_workers, threads_per_worker, chunk_size, memory_per_worker, float('inf')))\n    finally:\n        if client is not None:\n            client.close()\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p11554","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p11198","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p11196","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p11197","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p11208"},"y_scale":{"type":"object","name":"LinearScale","id":"p11209"},"title":{"type":"object","name":"Title","id":"p11201","attr
